import { useState } from "react";
import './UserDash.css';

function UserDash() {
  let products = [
    { name: "Mutton Briyani",price: 180, image: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSrsuYpzxqKQlFPdieuDyqZUtv7ep4tFPDlBA&s" },
    { name: "Chicken Briyani",price: 120, image: "data:image/jpeg;base64," },
    { name: "Non veg Meals",price: 130, image: "data:image/jpeg;base64," },
    { name: "Chicken Noodles",price: 90, image: "data:image/jpeg;base64," },
    { name: "Fish Kulambu",price: 120, image: "data:image/jpeg;base64," },
    { name: "Chicken Rice",price: 90, image: "data:image/jpeg;base64," },
    { name:"Veg Meals",price: 100,    image:"data:image/jpeg;base64,"},
    { name:"Mushroom Briyani",price: 80, image:"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTd-Ei-x-DAaKGZLixKEMLRZJRwuTl2HFvIcg&s"},
    { name:"Butter Fried Rice",price: 80,image:"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQPZm52JP3nJfZTv0HuDlyuKv8lRad50CqU3w&s"},
    { name:"Dosa",price: 50, image:"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSPwLD011gcA9B580EysxYs2E7t1_EVdAiaAg&s"},
    { name:"Idly",price: 20, image:"https://m.media-amazon.com/images/I/41Lm+0efauL._UF1000,1000_QL80_.jpg"},
    { name:"Poori",price: 30,image:"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQ8O7vG4vhR6UBsu0VDR7zsCpamA_hpCHPUiA&s"},
    { name:"Parotta",price: 20,image:"data:image/jpeg;base64,"},
    { name:"Chappathi",price: 15,image:"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcS33l_OiFZ104dhXWVWFKotjLRugtIuf7JCsg&s"},
    { name:"Idiyappam",price: 30,image:"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQipJ8JJyME1Cu0IF9SlFlX1nqaRecU0Q-FDw&s"}
  ];

  const [cart, setCart] = useState([]);

  const addToCart = (product) => {
    setCart((prev) => {
      // check if already in cart
      const existing = prev.find((item) => item.name === product.name);
      if (existing) {
        return prev.map((item) =>
          item.name === product.name ? { ...item, qty: item.qty + 1 } : item
        );
      } else {
        return [...prev, { ...product, qty: 1 }];
      }
    });
  };

  const updateQty = (name, amount) => {
    setCart((prev) =>
      prev
        .map((item) =>
          item.name === name ? { ...item, qty: Math.max(item.qty + amount, 1) } : item
        )
    );
  };

   const handleConfirmOrder = async () => {
  if (cart.length === 0) return alert("Cart is empty!");

  const order = {
    items: cart.map(item => ({ name: item.name, qty: item.qty, price: item.price })),
    total: cart.reduce((sum, item) => sum + item.price * item.qty, 0)
  };

  try {
    const response = await fetch("http://localhost:5000/orders", {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify(order)
    });

    if (response.ok) {
      alert(" Order Confirmed & Stored!");
      window.location.reload(); // reload after saving
    } else {
      const data = await response.json();
      console.error("Server returned error:", data);
      alert(" Failed to store order");
    }
  } catch (error) {
    console.error("Fetch failed:", error);
    alert(" Error connecting to server");
  }
};

  const discount = 10; // fixed discount for demo
  const total = cart.reduce((sum, item) => sum + item.price * item.qty, 0) ;

  return (
    <div className="full">
      <div className="body">
        <div className="header">
          <div className="left">
            <img src="./download.png" className="logo" alt="Logo" />
            <h3 className="title">EAT OUT!</h3>
          </div>
          <h1 className="head">ORDER MENU</h1>
        </div>

        <div className="cont">
          {products.map((item, index) => (
            <div className="b1" key={index}>
              <img src={item.image} alt={item.name} />
              <h4 className="h">{item.name}</h4>
              <p className="h">{item.price}</p>
              <button className="btn" onClick={() => addToCart(item)}>
                ADD CART
              </button>
            </div>
          ))}
        </div>

        {/* Bill Section */}
        <div className="bill">
          <h2>My Order</h2>
          {cart.map((item, idx) => (
            <div key={idx} className="bill-item">
              <img src={item.image} alt={item.name} className="bill-img" />
              <div className="bill-info">
                <p className="h">{item.name}</p>
                <div className="qty-control">
                  <button onClick={() => updateQty(item.name, -1)}className="h" >-</button>
                  <span className="h">{item.qty}</span>
                  <button onClick={() => updateQty(item.name, 1)}className="h">+</button>
                </div>
              </div>
              <p className="h">{item.price * item.qty}</p>
            </div>
          ))}

          <div className="bill-summary">
            <p className="h">Total: <strong>{total}</strong></p>
          </div>

          <button className="confirm-btn" onClick={ handleConfirmOrder}>Confirm Order</button>
        </div>
      </div>
    </div>
  );
}

export default UserDash;